function strpad(a,b,c,d){if("undefined"==typeof b)var b=0;if("undefined"==typeof c)var c=" ";if("undefined"==typeof d)var d=STR_PAD_RIGHT;if(b+1>=a.length)switch(d){case STR_PAD_LEFT:a=Array(b+1-a.length).join(c)+a;break;case STR_PAD_BOTH:var e=Math.ceil((padlen=b-a.length)/2),f=padlen-e;a=Array(f+1).join(c)+a+Array(e+1).join(c);break;default:a+=Array(b+1-a.length).join(c)}return a}var STR_PAD_LEFT=1,STR_PAD_RIGHT=2,STR_PAD_BOTH=3,logger={domainPadLength:20,domainSeparator:":",isActive:!0,logType:"info",logDomainStyles:{info:"background: #eaeaff; color: #1214ff;",error:"background: #ffeaea; color: #ff1214;",log:"background: #ffffff; color: #404040"},tempData:{},as:function(a){return logger.tempData.domainName=a,logger},log:function(){logger.logType="info",logger.finalLog.apply(logger,arguments)},info:function(){logger.logType="info",logger.finalLog.apply(logger,arguments)},error:function(){logger.logType="error",logger.finalLog.apply(logger,arguments)},finalLog:function(){for(var a=[],b=0;b<arguments.length;b++)a.push(arguments[b]);if(logger.tempData.domainName){var c=strpad(logger.tempData.domainName+" ",logger.domainPadLength," ",STR_PAD_LEFT)+logger.domainSeparator;a.unshift(c),a.unshift("font-weight: bold; "+logger.logDomainStyles[logger.logType]),a.unshift("%c%s")}logger.isActive&&console[logger.logType].apply(console,a),logger.tempData={}}};